import React from "react";
import {ResponsiveBar} from "@nivo/bar";



const Testsgraph = ({ genius, title}) => {
const data3 = genius.slice(0,15);
	return (
		<div style={{height: "700px", minWidth: "100%", padding: "0 1.2em"}}>
		<ResponsiveBar
        data={data3}
        keys={title}
        indexBy="country"
        margin={{ top: 50, right: 130, bottom: 50, left: 60 }}
        padding={0.3}
        layout="horizontal"
        valueScale={{ type: 'linear' }}
        indexScale={{ type: 'band', round: true }}
        theme={
            {
            textColor: "#41c7c7",
            fontSize: "16px"
        }}
        colors={{ scheme: 'set3' }}
        colorBy="index"
        borderRadius= {1}
        borderWidth={1}
        borderColor={{ from: 'color', modifiers: [ [ 'darker', 1.6 ] ] }}
        axisTop={null}
        axisRight={null}
        axisBottom={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: title,
            legendPosition: 'middle',
            legendOffset: 32
        }}
        axisLeft={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'country',
            legendPosition: 'middle',
            legendOffset: -55
        }}
        enableGridY={false}
        labelSkipWidth={12}
        labelSkipHeight={12}
        labelTextColor={{ from: 'color', modifiers: [ [ 'darker', 1.6 ] ] }}
        animate={true}
        motionStiffness={90}
        motionDamping={15}
    />
		</div>
		)
}

export default Testsgraph;
